import React, { useState, useEffect } from "react";

import UserService from "../services/user.service";

const Home = () => {
  const [content, setContent] = useState("");

  useEffect(() => {
    UserService.getPublicContent().then(
      (response) => {
        setContent(response.data);
      },
      (error) => {
        const _content =
          (error.response && error.response.data) ||
          error.message ||
          error.toString();

        setContent(_content);
      }
    );
  }, []);

  return (
    <div className="container">
      <header className="jumbotron">
        <h3>{content}</h3>
        <h3>Get best deals on loading and unloading</h3>
        <h3>Put advertisement of your items and transport people will bid for it.</h3>
        <h3>Lowest bidder's info will be shared with you.</h3>
      </header>
    </div>
  );
};

export default Home;
